import React from "react";
import Weather from "./components/Weather";
import "./App.css";

function App() {
  return (
    <div className="app">
      {/* <h1 className="header">Hello React!</h1> */}
      <Weather day="Sunday" high="35°" low="33°" />
      <Weather day="Monday" high="34°" low="26°" />
      <Weather day="Tuesday" high="34°" low="26°" />
      <Weather day="Wednesday" high="38°" low="32°" />
      <Weather day="Thursday" high="21°" low="17°" />
      <Weather day="Friday" high="14°" low="12°" />
      <Weather day="Saturday" high="8°" low="-4°" />
    </div>
  );
}
export default App;
